/**
 * 将界面上的操作符转换为 xml 中的操作符
 */
function fromOperatorUI(operator, value) {
    if (operator === 'contains') {
        return {
            operator: 'equal',
            val: "*".concat(value, "*")
        };
    }
    if (operator === 'beginsWith') {
        return {
            operator: 'equal',
            val: "".concat(value, "*")
        };
    }
    if (operator === 'endsWith') {
        return {
            operator: 'equal',
            val: "*".concat(value)
        };
    }
    if (operator === 'notContains') {
        return {
            operator: 'notEqual',
            val: "*".concat(value, "*")
        };
    }
    if (operator === 'notBeginsWith') {
        return {
            operator: 'notEqual',
            val: "".concat(value, "*")
        };
    }
    if (operator === 'notEndsWith') {
        return {
            operator: 'notEqual',
            val: "*".concat(value)
        };
    }
    // 前面应该已经处理完了
    return {
        operator: operator,
        val: value
    };
}

export { fromOperatorUI };
